import React from 'react';
import styled from "styled-components";

export const Main = () => {
    return (
        <div>
            <div>
                <span>Hi There</span>
                <h2>I am Aisultan Abdykerov</h2>
                <h1>A Web Developer. </h1>
            </div>
            <Photo src="./src/assets/images/main/photo_2023-10-12 12.50.59.jpeg" alt="no"/>
        </div>
    );
};

const Photo = styled.img`
  width: 350px;
  height: 430px;
`
